import React from 'react'

const Skills = () => {
  const skillset = [
    "ReactJS", "Javascript", "Python", "Java", "TailwindCSS", "MongoDB", "Git", "Figma", "G Suite", "SQL"
  ]
  return (
    <div className='max-w-5xl mx-auto mt-16'>
      <h1 className='text-blue-600 font-semibold text-3xl font-palanquin'>Skills <span className='text-black'>and</span> Technologies</h1>
      <p className='text-slate-gray mt-1 font-montserrat text-lg'>I can't lie, these are the driving force behind my success!</p>
      <div className='grid grid-rows-2 grid-cols-5 bg-gray-100 rounded-xl gap-4 mt-5'>

        {
          skillset.map((skill) => (
            <div className='contain w-full h-full'>
              <div className='flex items-center justify-center py-5'>
                <img
                 width={45}
                 src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/html5/html5-original.svg" />
              </div>
            </div>
          ))
        }


      </div>
    </div>
  )
}

export default Skills
